import zipfile
import re
import os


class ConstructionSiteReport():
    '''
    Class tạo báo cáo công trình cty DH
    '''
    def __init__(self, filename) -> None:
        self.filename = filename if os.path.splitext(filename)[1] == ".docx" else filename + ".docx"
        self.pages = ""

    def add_page(self,
                 date,
                 project_name,
                 project_id,
                 time_start_morning,
                 time_end_morning,
                 time_start_afternoon,
                 time_end_afternoon,
                 list_job_morning,
                 list_job_afternoon) -> None:
        if len(list_job_morning) < 4:
            list_job_morning += [" "] * (4 - len(list_job_morning))
        if len(list_job_afternoon) < 4:
            list_job_afternoon += [" "] * (4 - len(list_job_afternoon))
        self.pages += self.page_base % (date, project_name, project_id, time_start_morning, time_end_morning, time_start_afternoon, time_end_afternoon, list_job_morning[0], list_job_afternoon[0], list_job_morning[1], list_job_afternoon[1], list_job_morning[2], list_job_afternoon[2], list_job_morning[3], list_job_afternoon[3])

    def save(self, folder: str = ""):
        zipBase = zipfile.ZipFile(os.path.join(os.path.dirname(os.path.normpath(__file__)), "base.docx"), "r")
        output = zipfile.ZipFile(os.path.join(os.path.normpath(folder), self.filename), "w")
        for zipinfo in zipBase.infolist():
            buffer = zipBase.read(zipinfo.filename)
            if zipinfo.filename == 'word/document.xml':
                data = buffer.decode('utf-8')
                buffer = re.sub(r"(?<=<w:body>).+?(?=<w:sectPr)", self.pages, data).encode('utf-8')
            output.writestr(zipinfo, buffer)
        zipBase.close()
        output.close()

